def partition(low: int, high: int) -> int:
    i = low
    j = high
    pivot = a[low]

    while i < j:
        while a[i] <= pivot and i < high:
            i += 1
        while a[j] > pivot and j > low:
            j -= 1
        if i < j:
            a[i], a[j] = a[j], a[i]
    
    a[j], a[low] = a[low], a[j]
    return j

def quick_sort(low: int, high: int):
    if low < high:
        j = partition(low, high)
        quick_sort(low, j - 1)
        quick_sort(j + 1, high)

